import { Dialog, withStyles } from "@material-ui/core";

const style = {
  dialogPaper: {
    height: "100%",
    width: "100%",
    marginTop: "12%",
    boxShadow: "none",
    borderRadius: 0,
    maxHeight: "100%",
    maxWidth: "100%",
  },
};

const ChatBox = ({ classes }) => {
  return (
    <Dialog open={true} classes={{ paper: classes.dialogPaper }}>
      Hello
    </Dialog>
  );
};

export default withStyles(style)(ChatBox);
